            'text' => '{"en": {"title": "Calidad en", "subtitle": "COMPROMISO TER en", "text_calidad": "<p>Nuestro sector de producci&oacute;n cuenta con la m&aacute;s avanzada tecnolog&iacute;a, y para asegurar la m&aacute;xima calidad de nuestros productos, desde marzo del 2010 estamos certificados bajo las normas de calidad ISO 9000:2008. Desde nuestros inicios hemos tratado de superamos d&iacute;a a d&iacute;a para poder brindarles a nuestros clientes productos de calidad, tanto en el dise&ntilde;o, como en la producci&oacute;n y el servicio postventa. Como garant&iacute;a de ello, desde marzo del 2010 estarmos certificados bajo las normas de Calidad lSO 9001:2015 otorgado por el ente Rina (Italia).&nbsp; en</p>", "text_maquina": "<p>El programa de la calidad se encuentra basado en los requerimientos y especificaciones del cliente y en los est&aacute;ndares de la industria. A trav&eacute;s de todas las etapas de producci&oacute;n y comenzando desde la selecci&oacute;n y evaluaci&oacute;n de proveedores, la recepci&oacute;n de materias primas, los procesos de producci&oacute;n y el despacho final a los clientes, se realizan inspecciones y ensayos para verificar el cumplimiento de lo especificado. en</p>", "title_maquina": "Máquina de control de calidad en", "text_laboratorio": "<p>En complemento de nuestra planta propia contamos con un laboratorio propio de Investigaci&oacute;n y Desarrollo, con un &eacute;nfasis especial en la mejora continua y la trazabilidad de los procesos productivos. TER Aplicaciones Especiales es conciente de las exigencias de calidad y servicio que el mercado impone. A lo largo de los a&ntilde;os resaltamos el desaf&iacute;o de seguir siendo competitivos en el mercado de Tomas de Fuerza, Bombas Hidr&aacute;ulica, Cajas de Transferencia. en</p>", "title_laboratorio": "Laboratorio en"}, "es": {"title": "Calidad", "subtitle": "COMPROMISO TER", "text_calidad": "<p>Nuestro sector de producci&oacute;n cuenta con la m&aacute;s avanzada tecnolog&